import Navbar from "./components/Navbar";

const App = () => {
  return (
    <Box>
      {/* <Navbar /> */}
      <Stack ></Stack>
      <Sidebar />
      <Feed />
      <Rightbar />
    </Box>
  );
};

export default App;
